import Chart from '../components/Chart'
import BasicDateRangePicker from '../components/Datepick'
import Header from '../components/Header';
import { useState, useEffect } from 'react';
import axios from 'axios';
// const data= [{date: "2019-01-03", count: 15},
//              {date: "2019-01-05", count: 18},
//              {date: "2019-01-06", count: 32},
//              {date: "2019-01-07", count: 30},
//              {date: "2019-01-08", count: 100},
//              {date: "2019-01-09", count: 20},
//              {date: "2019-01-10", count: 50}
//             ]
function ReportProduct() {

    const fakedata = [{"Buy_Time":"2021-11-13T17:00:00.000Z","User_Id":1,"Bill_Id":1,"Product_Id":1,"Quantity":1,"Product_Name":"Súp","Price":5,"Fund":3.12},{"Buy_Time":"2021-11-13T17:00:00.000Z","User_Id":1,"Bill_Id":1,"Product_Id":2,"Quantity":3,"Product_Name":"BBQ","Price":15.2,"Fund":10.65},{"Buy_Time":"2021-11-11T17:00:00.000Z","User_Id":2,"Bill_Id":2,"Product_Id":1,"Quantity":2,"Product_Name":"Súp","Price":5,"Fund":3.12},{"Buy_Time":"2021-11-11T17:00:00.000Z","User_Id":2,"Bill_Id":2,"Product_Id":3,"Quantity":5,"Product_Name":"Trái cây","Price":4,"Fund":1.23}]
    const [data,setdata]=useState()
    
    useEffect(()=>{
      const getData = async ()=>{
        try {
          const res = await axios.get('http://localhost:9000/reports/list')
          // console.log(res.data.data[3].User_Id)
          // console.log(res.data['data'][0].Buy_Time)
          setdata(res.data)
          //console.log(res.data)
        } catch (error) {
          console.log(error.message)
        }
      }
      getData()
    },[])
    console.log(data)

    let min = new Date(data[0].Buy_Time)
    let max = new Date(data[0].Buy_Time)
    let time = []
    for (let i = 0; i< data.length; i++) {
      if (time.length == 0 ){
        time.push(data[i].Buy_Time)
      }
      else {
        let check = false
        for (let j = 0; j < time.length; j++){
          if (data[i].Buy_Time==time[j]){
            check = true
          }
        }
        if (check == false){
          time.push(data[i].Buy_Time)
        }
      }
    }
    console.log(time)

  return(
    
    <div class='container'>
      <Header/>
      <BasicDateRangePicker/>
      <Chart data={data} dataKey="count" title="Sản phẩm" xaxis="date"/>
    </div>
  )
}

export default ReportProduct;
